import React, { useState } from "react";

const GetByPhone = function () {
  const [data, setData] = useState("Здесь будет результат")
  const [phone, setPhone] = useState("")

  function findByPhone() {
    fetch("http://localhost:9000/find_by_phone?phone=" + phone, {
      method: 'GET',
      mode: "no-cors",
      headers: {
        "Access-Control-Allow-Origin": "localhost:9000"
      }
    })
      .then(response => {
        response.text()
      })
      .then(result => {
        console.log(result)
        setData(result.body)
      })
      .catch(e => {
        console.log(e);
        this.setState(e)});
  }

  return (
    <div>
      <input
        type="text"
        value={phone}
        onChange={e => setPhone(e.target.value)}
      />
      <button onClick={findByPhone}>Отправить</button>
      <div>
        {data}
      </div>

    </div>
  )
}

export default GetByPhone;
